import style from './CatalogPage.module.css';
import Header from '../../components/Header/Header';
import Product from '../../components/Product/Product';
import Cart from '../../components/Cart/Cart';
import React, { Component } from 'react';


class CatalogPage extends React.C {
    constructor(props) {
        super(props)
        this.state = {
          items: [
            {
              id: 1,
              imagе: "/product-images/product-1.png",
              title: "Slimming Gel Body",
              desc: "Гель для тела для похудения",
              price: 69.9,
          },
          {  
              id: 2,
              imagе: "/product-images/product-2.png",
              title: "Slimm Gel ",
              desc: "Лосьон для тела для похудения",
              price: 49.9,
          },
          {
            id: 3,
              imagе: "/product-images/product-3.png",
              title: "Slimming Gel ",
              desc: "Масло для тела",
              price: 39.9,
          },
          {
            id: 4,
              imagе: "/product-images/product-4.png",
              title: "Gel ",
              desc: "Гель для душа для похудения",
              price: 29.9,
          },
          {
            id: 5,
              imagе: "/product-images/product-5.png",
              title: "Slimming Gel ",
              desc: "Лосьон для тела для похудения",
              price: 18.9,
          },
          {
            id: 6,
              imagе: "/product-images/product-6.png",
              title: "Slimming Gel ",
              desc: "Лосьон для тела для похудения",
              price: 24.9,
          }
          ]
        }
      
    }


    render() {
        return (
            <div className={style['catalog-page']}>
                <Header />
                <div className={style['main']}>
                    <Product />
                    <Cart />
                </div>
            </div>
        );
    }
    
};

export default CatalogPage;
